(function(module) {
try {
  module = angular.module('mapper.views');
} catch (e) {
  module = angular.module('mapper.views', []);
}
module.run(['$templateCache', function($templateCache) {
  $templateCache.put('repoContext/repoChoiceCtrl',
    '<div class="row" ng-controller="RepoChoiceCtrl as repoChoiceCtrl"><div class="col-md-6"><div class="form-group"><label for="repo">Repo Name <input class="form-control" type="text" id="repo" ng-model="repoName" name="repo"></label> <button type="submit" class="btn btn-primary" ng-click="repoChoiceCtrl.setRepo(repoName)">Set Repo</button></div>{{repoChoiceCtrl.repos}}</div></div>');
}]);
})();
